import React, { useState, useRef } from "react";
import { Link } from "react-router-dom";
import PhoneIcon from "@mui/icons-material/Phone";
import HomeIcon from "@mui/icons-material/Home";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import AccountBalanceIcon from "@mui/icons-material/AccountBalance";
import VerifiedUserIcon from "@mui/icons-material/VerifiedUser";
import "./header.css";
import logo from "../../assets/images/logo.png";

export const Header = () => {
  const [showMoneyEffect, setShowMoneyEffect] = useState(false);
  const ctaButtonRef = useRef(null); // Create ref for CTA button

  const handleClick = () => {
    setShowMoneyEffect(true);
    setTimeout(() => setShowMoneyEffect(false), 1000); // Reset animation after 1s
    createFallingCoins(); // Add falling coins effect
  };

  const handleContactClick = () => {
    // Your contact button click handling logic
    alert("Contact button clicked!");
  };

  const createFallingCoins = () => {
    const container = document.querySelector('.falling-coins-container');
    if (!container) return;

    for (let i = 0; i < 10; i++) {
      const coin = document.createElement('div');
      coin.className = 'falling-coin';
      coin.textContent = 'ðŸ’°'; // Use a coin emoji or icon
      coin.style.left = `${Math.random() * 100}vw`; // Random horizontal position
      coin.style.animation = `fall ${Math.random() * 3 + 2}s linear`; // Random duration
      container.appendChild(coin);
      // Remove the coin after animation completes
      setTimeout(() => container.removeChild(coin), 5000);
    }
  };

  return (
    <header className="header">
      <div className="logo">
        <img src={logo} alt="logo" className="logo-image" />
      </div>
      <nav>
        <ul>
          <li className="nav-item">
            <Link
              to="/"
              onClick={handleClick}
              className={showMoneyEffect ? "active" : ""}
            >
              <HomeIcon className="nav-icon" /> Home
              {showMoneyEffect && <div className="money-effect">$</div>}
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="/accounting-services"
              onClick={handleClick}
              className={showMoneyEffect ? "active" : ""}
            >
              <AccountBalanceIcon className="nav-icon" /> Accounting Services
              {showMoneyEffect && <div className="money-effect">$</div>}
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="/dsc"
              onClick={handleClick}
              className={showMoneyEffect ? "active" : ""}
            >
              <VerifiedUserIcon className="nav-icon" /> DSC Services
              {showMoneyEffect && <div className="money-effect">$</div>}
            </Link>
          </li>
          <li className="nav-item">
            <Link
              to="/about"
              onClick={handleClick}
              className={showMoneyEffect ? "active" : ""}
            >
              <AccountCircleIcon className="nav-icon" /> About Us
              {showMoneyEffect && <div className="money-effect">$</div>}
            </Link>
          </li>
        </ul>
      </nav>
      <div className="cta-section">
        <div className="cta-button" ref={ctaButtonRef}>
          <button onClick={handleContactClick}>
            <PhoneIcon className="cta-icon" /> CONTACT US
          </button>
        </div>
      </div>
      <div className="falling-coins-container"></div> {/* Container for falling coins */}
    </header>
  );
};
